// Photo Gallery Function with persistent storage
function setupPhotoGallery() {
  const photoItems = document.querySelectorAll('.photo-item');
  
  // Load saved photos on page load
  loadSavedPhotos();
  
  photoItems.forEach((item, index) => {
    item.addEventListener('click', function() {
      // Create file input for photo upload
      const input = document.createElement('input');
      input.type = 'file';
      input.accept = 'image/*';
      
      input.onchange = function(e) {
        const file = e.target.files[0];
        if (file) {
          const reader = new FileReader();
          reader.onload = function(e) {
            const img = document.createElement('img');
            img.src = e.target.result;
            img.style.width = '100%';
            img.style.height = '100%';
            img.style.objectFit = 'cover';
            img.style.borderRadius = '10px';
            
            // Clear placeholder and add image
            item.innerHTML = '';
            item.appendChild(img);
            item.classList.add('loaded');
            
            // Save photo to localStorage AND update the code
            savePhotoToStorage(index, e.target.result);
            
            // Add right-click to remove individual photo
            addRemovePhotoListener(item, index);
            
            // Add sparkle effect
            createSparkles(item);
            
            // Show success message
            showToast('Foto berhasil disimpan! Akan muncul di semua device.');
          };
          reader.readAsDataURL(file);
        }
      };
      
      input.click();
    });
  });
}

// Save photo to localStorage and update the persistent storage
function savePhotoToStorage(index, imageData) {
  try {
    const savedPhotos = JSON.parse(localStorage.getItem('loveLetterPhotos') || '{}');
    savedPhotos[index] = imageData;
    localStorage.setItem('loveLetterPhotos', JSON.stringify(savedPhotos));
    console.log(`Photo ${index} saved to localStorage`);
    
    // Also save to sessionStorage for immediate persistence
    sessionStorage.setItem(`photo_${index}`, imageData);
    
    // Update the persistent storage in the code
    updatePersistentStorage(index, imageData);
    
  } catch (error) {
    console.error('Error saving photo:', error);
    // If localStorage is full, try to compress the image
    compressAndSaveImage(index, imageData);
  }
}

