// Load saved photos from localStorage
function loadSavedPhotos() {
  try {
    const savedPhotos = JSON.parse(localStorage.getItem('loveLetterPhotos') || '{}');
    const photoItems = document.querySelectorAll('.photo-item');
    
    photoItems.forEach((item, index) => {
      if (savedPhotos[index]) {
        const img = document.createElement('img');
        img.src = savedPhotos[index];
        img.style.width = '100%';
        img.style.height = '100%';
        img.style.objectFit = 'cover';
        img.style.borderRadius = '10px';
        
        // Clear placeholder and add saved image
        item.innerHTML = '';
        item.appendChild(img);
        item.classList.add('loaded');
        
        // Add right-click to remove individual photo
        addRemovePhotoListener(item, index);
      }
    });
  } catch (error) {
    console.error('Error loading saved photos:', error);
  }
}

// Add right-click listener to remove individual photo
function addRemovePhotoListener(item, index) {
  item.addEventListener('contextmenu', function(e) {
    e.preventDefault();
    if (confirm('Remove this photo?')) {
      removePhotoFromStorage(index);
      resetPhotoItem(item);
    }
  });
}

// Remove photo from localStorage
function removePhotoFromStorage(index) {
  try {
    const savedPhotos = JSON.parse(localStorage.getItem('loveLetterPhotos') || '{}');
    delete savedPhotos[index];
    localStorage.setItem('loveLetterPhotos', JSON.stringify(savedPhotos));
    sessionStorage.removeItem(`photo_${index}`);
    console.log(`Photo ${index} removed from localStorage`);
  } catch (error) {
    console.error('Error removing photo:', error);
  }
}

