// Compress image if localStorage is full
function compressAndSaveImage(index, imageData) {
  const img = new Image();
  img.onload = function() {
    const canvas = document.createElement('canvas');
    const ctx = canvas.getContext('2d');
    
    // Set smaller dimensions for compression
    const maxWidth = 400;
    const maxHeight = 400;
    let { width, height } = img;
    
    if (width > height) {
      if (width > maxWidth) {
        height = (height * maxWidth) / width;
        width = maxWidth;
      }
    } else {
      if (height > maxHeight) {
        width = (width * maxHeight) / height;
        height = maxHeight;
      }
    }
    
    canvas.width = width;
    canvas.height = height;
    
    // Draw and compress
    ctx.drawImage(img, 0, 0, width, height);
    const compressedData = canvas.toDataURL('image/jpeg', 0.7);
    
    // Try to save compressed image
    try {
      const savedPhotos = JSON.parse(localStorage.getItem('loveLetterPhotos') || '{}');
      savedPhotos[index] = compressedData;
      localStorage.setItem('loveLetterPhotos', JSON.stringify(savedPhotos));
      console.log(`Compressed photo ${index} saved to localStorage`);
    } catch (error) {
      console.error('Error saving compressed photo:', error);
      showToast('Storage full! Please clear some photos first.');
    }
  };
  img.src = imageData;
}

