function addClickToReveal() {
  const paragraphs = document.querySelectorAll('.animated-paragraph');
  
  paragraphs.forEach((paragraph, index) => {
    paragraph.style.cursor = 'pointer';
    paragraph.classList.add('clickable-paragraph');
    
    paragraph.addEventListener('click', function() {
      if (!this.classList.contains('revealed')) {
        this.classList.add('revealed');
        this.style.transform = 'scale(1.02)';
        this.style.background = 'rgba(255, 182, 193, 0.1)';
        this.style.padding = '15px';
        this.style.borderRadius = '10px';
        this.style.transition = 'all 0.3s ease';
        
        // Add sparkle effect
        createSparkles(this);
        
        setTimeout(() => {
          this.style.transform = 'scale(1)';
        }, 300);
      }
    });
  });
}

function createSparkles(element) {
  for (let i = 0; i < 5; i++) {
    setTimeout(() => {
      const sparkle = document.createElement('div');
      sparkle.innerHTML = 'âœ¨';
      sparkle.style.position = 'absolute';
      sparkle.style.fontSize = '20px';
      sparkle.style.pointerEvents = 'none';
      sparkle.style.zIndex = '1000';
      sparkle.style.animation = 'sparkleEffect 1s ease-out forwards';
      
      const rect = element.getBoundingClientRect();
      sparkle.style.left = (rect.left + Math.random() * rect.width) + 'px';
      sparkle.style.top = (rect.top + Math.random() * rect.height) + 'px';
      
      document.body.appendChild(sparkle);
      
      setTimeout(() => sparkle.remove(), 1000);
    }, i * 100);
  }
}

function playMusic() {
  const music = document.getElementById("bgMusic");
  const musicBtn = document.querySelector(".music-btn");
  
  music.play().then(() => {
    musicBtn.classList.add("playing");
    musicBtn.title = "Pause Music";
  }).catch(error => {
    console.log("Music autoplay blocked:", error);
  });
}

function toggleMusic() {
  const music = document.getElementById("bgMusic");
  const musicBtn = document.querySelector(".music-btn");
  
  if (music.paused) {
    music.play();
    musicBtn.classList.add("playing");
    musicBtn.title = "Pause Music";
  } else {
    music.pause();
    musicBtn.classList.remove("playing");
    musicBtn.title = "Play Music";
  }
}

